            if left in variables:
                variables[left].append(right)
            elif right in variables:
                variables[right].append(left)
    return variables

def generate_json_string(equations):
    result = []
    for equation in equations:
        variables = extract_variables(equation)
        variable_names = [variable[0] for variable in variables.values()]
        result.append(json.dumps(variable_names))
    return '\n'.join(result)

